import React, { useEffect, useState } from 'react';


const CreatedProducts = () => {
    const [products, setProducts] = useState([{
        name: '',
        price: '',
        origin: ''
    }])
    useEffect(() => {
        fetch('https://cloud.mongodb.com/v2/600d51e1648a9c7e37e890e1#metrics/replicaSet/600d60203bb0f04489ea000a/explorer/yalantis/products').then(res => {
            console.log(res)
            if(res.ok) {
                return res.json()
            }
        }).then(jsonRes => setProducts(jsonRes));
    })
    return (
        <div className="createdProductsPage">
            {products.map((product, id) => 
                <div key={id}>
                    <h1>{product.name}</h1>
                    <h2>{product.price}</h2>
                    <h3>{product.origin}</h3>
                </div>
            )}
        </div>
    )
}

export default CreatedProducts;
